import {
    Card,
    CardBody,
    CardTitle,
    CardSubtitle,
    CardText,
    Button
} from 'reactstrap'
import 'bootstrap/dist/css/bootstrap.min.css';
import './Posts.css'

const posts = [
    { autor: 'Pepe', tema: 'experiencias', contenido: 'ayer me tire a una madurita' },
    { autor: 'Manolete', tema: 'experiencias', contenido: 'Ayer fui de cariñosonas' }

];

function Posts() {
    return (
        <div className='contenedor-posts'>
        {posts.map((x) => (
            <Card
            body
            className='post'
            color="dark"
            inverse
            style={{
            minWidth: '18rem'
            }}>
            <CardBody>
                <CardTitle tag="h5">
                    {x.autor}
                </CardTitle>
                <CardSubtitle
                className="mb-2"
                tag="h6"
                >
                    {x.tema}
                </CardSubtitle>
                <div className='contenido-post'>
                    <img
                    className='imagen-perfil'
                    alt="Sample"
                    src="https://picsum.photos/300/200"
                    />
                    <CardText>
                    {x.contenido}
                </CardText>
                </div>
                <Button>
                Button
                </Button>
            </CardBody>
            </Card>
        ))}
        </div>
    );
}

export default Posts;
